import React from 'react';
import { NavLink } from 'react-router-dom';
import classes from './Colors.module.css';

const blue = props => (
    <div className={[classes.blue, classes.color].join(' ')}>
        <h1>Blue</h1>
        <NavLink to="/">Return to Main</NavLink>
    </div>
);

export default blue;
